import React from "react";
import List from "@mui/material/List";
import ListItem from "@mui/material/ListItem";
import Typography from "@mui/material/Typography";
import TableContainer from "@mui/material/TableContainer";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";
import { format } from "date-fns";

function createInfo(inputDate: any, info: any) {
  const formatday = format(inputDate, "yyyy年MM月dd日 HH:mm:ss");
  return (
    <Typography>
      {formatday}：{info}
    </Typography>
  );
}
const informations = [
  createInfo(20230312, "おおおお"),
  createInfo(20230311, "ええええ"),
  createInfo(20230310, "うううう"),
  createInfo(20230309, "いいいい"),
  createInfo(20230308, "ああああ"),
];
function WhatNew() {
  return (
    <div className="WhatNew">
      <Typography variant="h6" style={{ color: "red" }}>
        ＜新着情報＞
      </Typography>
      {informations.map((item, index) => {
        return { item };
      })}
    </div>
  );
}

export default WhatNew;
